import { Button, DatePicker, Form, Input, Row, Col } from "antd";
import React from "react";

const ContactDetailsForm = ({ onFinish, initialValues }) => {
  return (
    <>
      <Row type="flex" justify="center" align="center">
        <Col span={4}>
          <Form
            onFinish={onFinish}
            initialValues={initialValues}
            layout="vertical"
          >
            <Form.Item
              label="Email Address"
              name={"email"}
              rules={[
                {
                  required: true,
                  type: "email",
                  message: "Please Enter Email Address",
                },
              ]}
            >
              <Input />
            </Form.Item>
            <Form.Item
              label="Phone Number"
              name={"phone"}
              rules={[
                {
                  required: true,
                  message: "Please Enter Phone Number",
                },
              ]}
            >
              <Input />
            </Form.Item>
            <Form.Item>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
        </Col>
      </Row>
    </>
  );
};

export default ContactDetailsForm;
